@mpwolke @yvonnef Rosalind is a good way to develop your Python skills while learning Bioinformatics. Each problem works the same way: get the code working with some easy data, followed by some not so easy, then download a real dataset, process and upload, within 5 minutes. That is really easy for problems like this one, but solving within 5 minutes quickly gets harder, so you need to learn to code efficiently. It's a bit like kaggle, in that the answer is sitting there in the data: you just need to find it.
Rosalind is related to Coursera's Bioinformatics Specialization. I have completed the first 3. The instructors, Pavel Pevzner and Phillip Compeau founded Rosalind and Stepik, and there are problems based on the Specialization and the textbook.
Here's a short video on the Bioinformatics Specialization. One of the courses introduced me to Coronaviruses before they became fashionable. I hope you enjoy exploring Bioinformatics.

The Kaggle community has tremendous expertise regarding Google's open source ML software ecosystem and this prize is intended to celebrate some of our favorite recently shared tutorials. Thank you so much everyone for contributing public notebooks to Kaggle! 
The winners for the January 2022 Google OSS Expert Prize are as follows:

@awsaf49's notebook SETI-BL: TF Starter TPU 🚀 demonstrates expertise of various open source ML frameworks from Google including TensorFlow, tf.data, and tf.Keras, and it takes advantage of Google's TFRecord format to help reduce model training times when run on a Tensor Processing Unit.  Great work @awsaf49!
@ipythonx's notebook [TF.Keras]: Learning to Resize Image for ViT Model uses TensorFlow, tf.data, and tf.keras and can be run on either GPU or TPU. It is great to see how useful transformer architectures can be for so many seemingly disparate tasks! Great work @ipythonx!
@aakashnain's notebook Building models in JAX - Part1 (Stax) gives a great overview of Google's JAX framework and demonstrates how to perform accelerated numerical computations. Models and data augmentation are done purely in JAX. If you like building neural networks in JAX we recommend checking out FLAX as well!  Great work @aakashnain!

Honorable mentions:

An honorable mention goes to @akash0's notebook TicTacToe for Beginners. It uses the TensorFlow Agents framework to demonstrate how to create a bot that can play Tic-tac-toe - and serves as a good intro for the types of knowledge needed to participate in simulation competitions on Kaggle. It touches on concepts such as environments, gyms, reinforcement learning, and Q-learning, and it contains lots of well documented code snippets that are very helpful for data scientists that want to learn even more.  Great work @akash0!

The Kaggle Team will reach out to the winners shortly with instructions on how to collect their prizes.
